import React, { Component } from 'react';
import classes from './TestUI.module.css';
class TestUI extends Component {
    render() {
        return (
            <div className={classes.count}>
                <button > - </button>
                <div className={classes.number}> 1</div>
                <button> +</button>
 
</div>



        );
    };
}

export default TestUI;
